import { JobDetailsEnum } from "./job-type";
import "./job-detail.css"

interface Props {
    type: string,
    description: string
}

function JobDetail (props: Props) {
  const { type, description } = props;

    switch (type) {
        case JobDetailsEnum.COMPANY:
            //@todo: add ICON
            return <template className="job-details-company"><span>{description}</span></template>;
        case JobDetailsEnum.LOCATION:
            //@todo: add ICON
            return <template className="job-details-location"><span>{description}</span></template>;
        case JobDetailsEnum.NONE:
            return <template className="job-details-none"><span>{description}</span></template>;
    }
}

export default JobDetail;
